import React, { useEffect, useState } from "react";
import Button from "../button/Button";
import { withRouter } from "react-router-dom";
function Showdata(props) {
  useEffect(() => {
    //componentdidmount function
    fetchItems();
  }, []);

  //var whichcomp = "";

  const [items, setItems] = useState([]);
  const [whichcomp1, setcomp] = useState(props.location.ugugdul); //turshilt
  const fetchItems = async () => {
    ///////////didmount ued hiih ymnuud
    // const getdata = new URLSearchParams(props.location.ugugdul);
    // for (let a of getdata.entries()) {
    //   break;
    // }
    //console.log(whichcomp);

    const data = await fetch("/showdata");
    const items = await data.json();
    setItems(items);
  };
  const code_inquiry = (
    <div>
      <section>
        {items.map((item) => (
          <div>
            <h1>Results that came from Гүйлгээ шалгах</h1>
            <p>{item.name}</p>
            <p>{item.number}</p>
            <p>{item.height}</p>
            <Button txt="Back"></Button>
          </div>
        ))}
      </section>
    </div>
  );
  const code_invoice = (
    <div>
      <section>
        {items.map((item) => (
          <div>
            <h1>Results that came from Нэхэмжлэл үүсгэх</h1>
            <p>{item.name}</p>
            <p>{item.number}</p>
            <Button txt="Back"></Button>
          </div>
        ))}
      </section>
    </div>
  );
  const code_tokens = (
    <div>
      <section>
        {items.map((item) => (
          <div>
            <h1>Results that came from Токеноор гүйлгээ хийх</h1>
            <p>{item.name}</p>
            <p>{item.height}</p>
            <Button txt="Back"></Button>
          </div>
        ))}
      </section>
    </div>
  );

  switch (whichcomp1) {
    case "inquiry":
      return code_inquiry;
    case "invoice":
      return code_invoice;
    case "tokens":
      return code_tokens;
    default:
      props.history.push("/");
      break;
  }
}

export default withRouter(Showdata);
